import { Link } from "react-router-dom"

export function DriversButton() {

    return (
        <Link to="/drivers" className="border w-1/2 flex flex-col items-center">
                <div className="text-2xl -bold">Drivers</div>
                <div className="text-lg">View</div>
                <div className="text-lg">Create</div>
                <div className="text-lg">Edit</div>
       </Link>
    )
}
